import './App.css';
import Form from './components/Form';
import CardFront from './images/bg-card-front.png';
import CardBack from './images/bg-card-back.png';
function App() {
  return (
    <div className="App w-full h-full flex items-center justify-start">
      <div className='card'>
        <img src={CardFront} className='position-absolute' 
              alt='Card front'/>
        <img src={CardBack} 
              alt='Card front'/>
      </div>
      <div className='form flex justify-center items-center w-full h-full'>
        <Form />
      </div>
    </div>
  );
}

export default App;
